import React from 'react';
import styles from '../styles/Hero.module.css';

const Hero = () => {
    return (
      <div className={styles.hero}>
        <div className={styles.content}>
          <blockquote className={styles.quote}>
            “It’s through mistakes that you actually can grow. You have to get bad in order to get good”
            <cite>— Paula Scher</cite>
          </blockquote>
          <h1 className={styles.title}>Hi, I am Aisha Amer</h1>
          <p className={styles.description}>I am a UX designer with proficient skills in analytics and user-centered design who is inquisitive, empathetic, and an aesthetically versatile visual communicator.</p>
        </div>
      </div>
    );
};

export default Hero;
